-- Function to play an animation on the player
local function PlayAnim(animName)
    local player = GetLocalPlayerEntityId()
    local animFile = AnimArchetypes[animName]
    if not animFile then
        print("Animation not found: " .. tostring(animName))
        return
    end

    -- Plays the animation on the player
    RequestDominoAnimationState(player, animFile, 0, 0, "-1")

    -- Notification to inform which animation is playing
    ScriptHook.ShowNotification("Tocando animação: " .. animName)
end

-- Function to create the animations menu
local function AnimationsMenu()
    local menu = UI.SimpleMenu()
    menu:SetTitle("Animation Menu by JamesLurk")
    menu:AddSearch("Search", "Type to filter")

    for animName, _ in pairs(AnimArchetypes) do
        -- Passing an empty string "" as the second argument prevents errors
        menu:AddButton(animName, "", function()
            PlayAnim(animName)
        end)
    end

    return menu
end

-- Adds the menu to the main trainer
table.insert(SimpleTrainerMenuItems, {
    "Animation Menu by JamesLurk",
    "Choose and play an animation",
    Script():CacheMenu(AnimationsMenu)
})
